import React, { Component } from "react";
import { render } from "react-dom";
import BuyForm from "./BuyForm";

class Main extends Component {
  constructor(props) {
    super(props);
    this.state = {
      output: "0",
    };
  }

  render() {
    return (
      <div id="content">
        <div className="card mb-4">
          <div className="card-body">
            <BuyForm />
          </div>
        </div>
      </div>
    );
  }
}

export default Main;
